import React, { useEffect, useState} from 'react';
import { Link, useHistory } from 'react-router-dom';
import styled from 'styled-components';

const Styles = styled.div`
background:rgb(241,18,37);
color: white;
height: 5vh;
`;

function NavBar() {
    return(
        <React.Fragment>
            <Styles>
            this is navbar
            </Styles>
        </React.Fragment>
    )
}

export default NavBar;
